import React from 'react';
import '../css/rentalworks.css';
import Rentvideo from '../media/rentalworks.mp4'
import 'bootstrap/dist/css/bootstrap.min.css';

const Rentalworks = () => {

  return (
    // <div>
    //   <video
    //     src={Rentvideo}
    //     muted
    //     autoPlay={"autoplay"}
    //     preLoad="auto"
    //     loop 
    //   ></video>
    // </div>

    <Container fluid="md">
      <Row>
        <Col><video
         src={Rentvideo}
        muted
        autoPlay={"autoplay"}
        preLoad="auto"
        loop 
      ></video></Col>
      </Row>
    </Container>
  )
}

export default Rentalworks
